function jTropiq(e){return new jTropiq.fn.init(e)}jTropiq.fn=jTropiq.prototype={init:function(e){this.length=0;if(e){if(e.nodeType){this[this.length++]=e}else if(typeof e=="string"){this.init(document.querySelectorAll(e))}else if(e.length){var t=0,n=e.length;for(;t<n;t++){this[this.length++]=e[t]}}}},toArray:function(){return Array.prototype.slice.call(this)},each:function(e){var t=0,n=this.length;for(;t<n;t++){e.call(this[t],t,this[t])}return this}};jTropiq.fn.constructor=jTropiq;jTropiq.fn.init.prototype=jTropiq.fn;if(!window.$){window.$=jTropiq}